import Vue from 'vue'
import Router from 'vue-router'
import index from './pages/index'
import configuration from '@/pages/configuration'
import table from './pages/table'

Vue.use(Router)

var router = new Router({
	mode: 'history',
	base: '/element',
	routes: [
		{
			path: '/',
			name: 'index',
			component: index
		},
		{
			path: '/configuration/',
			name: 'config',
			component: configuration
		},
		{
			path: '/table/:name',
			name: 'tableDetail',
			component: table
		}
	]
});

export default router;
